inline constexpr int SONG_COUNT = sizeof(SONGS) / sizeof(SONGS[0]);

// Lookup by song ID
inline const SongInfo* findById(int id) {
    for (int i = 0; i < SONG_COUNT; i++) {
        if (SONGS[i].id == id) return &SONGS[i];
    }
    return nullptr;
}

// Lookup by nameId
inline const SongInfo* findByNameId(const std::string& nameId) {
    for (int i = 0; i < SONG_COUNT; i++) {
        if (nameId == SONGS[i].nameId) return &SONGS[i];
    }
    return nullptr;
}

